        alt=""
        src={rectangle375}
      />
      <div className="self-stretch flex flex-row items-start justify-start py-[0.175rem] px-[0rem] gap-[0.25rem] z-[1]">
        <img
          className="h-[1.406rem] w-[1.406rem] relative"
          loading="lazy"
          alt=""
          src={union}
